import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './pages/Login';
import Register from './pages/Register';
import DashboardAdmin from './pages/DashboardAdmin';
import DashboardUser from './pages/DashboardUser';
import DashboardOwner from './pages/DashboardOwner';
import StoreList from './pages/StoreList';
import ProtectedRoute from './components/ProtectedRoute';
import Navbar from './components/Navbar';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Navigate to="/login" />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        <Route path="/dashboard/admin" element={<ProtectedRoute role="admin"><DashboardAdmin /></ProtectedRoute>} />
        <Route path="/dashboard/user" element={<ProtectedRoute role="user"><DashboardUser /></ProtectedRoute>} />
        <Route path="/dashboard/owner" element={<ProtectedRoute role="owner"><DashboardOwner /></ProtectedRoute>} />

        <Route path="/stores" element={<ProtectedRoute><StoreList /></ProtectedRoute>} />
      </Routes>
    </Router>
  );
}

export default App;
